import React from "react";
import { useState } from "react";
import carNames from "./cars";

function App() {

    const [car, setCar] = useState(carNames);
    function clickHandle(id) {
        const newCarArray = car.filter(item => item.id != id);
        setCar(newCarArray);
    }
    return <div>
        {car.map(item => {
            return <div><h1 key={item.id}>{item.note}</h1>
            <button onClick={item.id}>-</button>
            </div>
        })}

    </div>;
}


export default App;
